import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Header = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', borderBottom: '20px solid black', borderLeft: '750px solid black', borderRight: '390px solid black', borderTop: '20px solid black' }}>
      <Toolbar sx={{ justifyContent: 'space-between' }}>
        <Typography variant="h6" component="div" sx={{ color: 'black' }}>
          Your Website
        </Typography>
        <div sx={{ backgroundColor: 'white', display: 'flex', gap: '10px' }}>
          <Button color="inherit">Login</Button>
          <Button color="inherit">Sign Up</Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
